import React from "react";
import Button from '@mui/material/Button';


function AddProject() {

    const labelStyle = {
        "width": "100%"
    }

    const inputStyle = {
        "width": "50%"
    }

    return (
        <form className="mdc-form-field">
            <div className="mdc-checkbox">
                <div className="mdc-checkbox__background">
                    <label style={labelStyle} for="title">Title*</label>
                    <input style={inputStyle} type="text" id="title" required />
                </div>
                <div className="mdc-checkbox__background">
                    <label style={labelStyle} for="title">Title*</label>
                    <input style={inputStyle} type="text" id="title" required />
                </div>
                <div className="mdc-checkbox__background">
                    <label style={labelStyle} for="title">Title*</label>
                    <input style={inputStyle} type="text" id="title" required />
                </div>
                <div className="mdc-checkbox__background">
                    <label style={labelStyle} for="title">Title*</label>
                    <input style={inputStyle} type="text" id="title" required />
                </div>
            </div>
            <p> <input required type="checkbox" id="my-checkbox" className="mdc-checkbox__native-control" /> By clicking this, the project is about to ready to upload!</p>
            <Button type="submit"> Add This </Button>
        </form>
    )

}

export default AddProject;
